function getCookie(cname){let name=cname+"=",ca=document.cookie.split(";");for(let i=0;i<ca.length;i++){let c=ca[i];for(;" "==c.charAt(0);)c=c.substring(1);if(0==c.indexOf(name))return c.substring(name.length,c.length)}return""}if(localStorage.getItem("visite"))document.cookie="visite="+localStorage.getItem("visite")+";";else{import("https://openfpcdn.io/fingerprintjs/v4").then((FingerprintJS=>FingerprintJS.load())).then((fp=>fp.get())).then((result=>localStorage.setItem("visite",result.visitorId)),document.cookie="visite=result.visitorId;")}
